insert into sneakers values (default, current_timestamp(), current_timestamp(), 'From the streets to the trails to anywhere in between, the Nike Free Terra Vista makes everything common ground. Made with at least 20% recycled content by weight, this pair will be your go-to for all your wild adventures. Its rugged upper features mesh, webbing and other durable textiles for an outdoorsy vibe.', 'https://media2.fenom.com/75956-product_large/nike-free-terra-vista-bright-spruce.jpg', 11900, 18, 'Nike Free Terra Vista Bright Spruce', 'MALE', 'Bright Spruce', 1);
