insert into sneakers values (default, current_timestamp(), current_timestamp(), 'The shoes are sold in 5 different styles, low, mid, superlow, high and super high. The mid comes with a connected strap. The high-top Air Force 1s come with a velcro strap; the mid-top strap is secured to the shoe while the high-top''s strap is movable and removable on some versions. Although the shoe comes in different colors and color schemes, the most common Air Force 1s sold are solid white (also referred to as "white on white"), the second most common being solid black ("black on black").', 'https://media2.fenom.com/75970-product_large/nike-air-force-1-lx-off-noir.jpg', 12800, 9, 'Nike Air Force 1 Off Noir', 'MALE', 'Off Noir', 2);
