insert into sneakers values (default, current_timestamp(), current_timestamp(), 'Nike Air Max is a line of shoes produced by Nike, Inc., with the first model released in 1987. Air Max shoes are identified by their midsoles incorporating flexible urethane pouches filled with pressurized gas, visible from the exterior of the shoe and intended to provide cushioning to the underfoot. Air Max was conceptualized by Tinker Hatfield, who initially worked for Nike designing stores.', 'https://media3.fenom.com/70076-product_large/nike-w-air-max-96-ii-cherry.jpg', 17000, 22, 'Nike Air Max 96 II Cherry', 'FEMALE', 'Cherry', 3);
insert into sneakers values (default, current_timestamp(), current_timestamp(), 'It’s been 20 years since Nike (NYSE:NKE +0.88%) first debuted the classic Air Max 95, which marked a big shift in the performance running sneaker market at the time. With its distinct rippled design across its upper, gradient gray color scheme, and bright neon yellow accents, the original model was a bold, provocative silhouette that had not been preceded by any sneaker before its time. Nike brought on board Nike ACG designer Sergio Lozano to spearhead the project, a trained industrial designer whose four-year experience with tennis and training shoes would bring a fresh perspective to the Air Max family.', 'https://media1.fenom.com/76194-product_large/nike-air-max-95-nh-ironstone.jpg', 17900, 10, 'Nike Air Max 95 Ironstone', 'MALE', 'Ironstone', 4);
