insert into sneakers values (default, current_timestamp(), current_timestamp(), 'Made of thousands of little balls of polyurethane, these Streetball 2.0 sneakers with BOOST™ gives you back a large part of the energy used on each impact, which is the same as a more explosive and minimal effort takeoff the ground. Express shipping with UPS, you will receive your order between 1 and 2 working days.', 'https://media3.fenom.com/75573-product_large/adidas-streetball-ii-orbit-greenmagic-lime.jpg', 13900, 10, 'Adidas StreetBall II Magic Lime', 'MALE', 'Magic Lime', 6);
