insert into sneakers values (default, current_timestamp(), current_timestamp(), 'The 574 Sport brings New Balance''s newest running technology and a touch of current fashion into one shoe. That technology comes in the form of a Fresh Foam midsole and an Abzorb crash pad, while the style comes from an ankle collar and tongue that create a bootie-like fit. You can also buy a women''s version.', 'https://media2.fenom.com/72564-product_large/new-balance-ml574-ba2-grey.jpg', 5340, 9, 'New Balance ML574 Grey', 'MALE', 'Grey', 9);
insert into sneakers values (default, current_timestamp(), current_timestamp(), 'Sneakerheads who appreciate the vibe of our 70s-era running shoes are sure to love the 237. Taking cues from our heritage designs, these casual sneakers for men blend a retro look with modern styling for a versatile and stylish silhouette that keeps your streetwear looking sharp. The suede and mesh upper with lace-up construction provides a secure, comfortable all-day fit.', 'https://media1.fenom.com/72556-product_large/new-balance-ms237-hr1-workwear.jpg', 5940, 9, 'New Balance MS 237 Workwear', 'MALE', 'Workwear', 10);
insert into sneakers values (default, current_timestamp(), current_timestamp(), 'The New Balance M577 is one of the brand''s best-known 80s running shoes, with multi-layered upper and heel counterparts for excellent support. With the M577 PSG, New Balance presents a special edition, made in the UK with smooth, buttery soft leather and suede upper.', 'https://media3.fenom.com/70364-product_large/new-balance-m577-lib-lava-ice-beach-made-in-uk.jpg', 10740, 6, 'New Balance M 577 Ice Beach', 'MALE', 'Ice Beach', 11);
insert into sneakers values (default, current_timestamp(), current_timestamp(), 'The New Balance 1500 enjoys quite the following, which isn’t really suppressing, as this retro running shoe from 1989 has seen the evolution of the culture and never went out of style. The latest edition points to the OG colorway of the New Balance 991 with its navy blue and grey theme, combining two heavy-hitters out of the New Balance portfolio in one.', 'https://media1.fenom.com/68544-product_large/new-balance-m1500-ggy-bring-back-made-in-uk.jpg', 11340, 4, 'New Balance M 1500 Bring Back', 'MALE', 'Bring Back', 12);
