insert into sneakers values (default, current_timestamp(), current_timestamp(), 'With the Air Jordan 1 Acclimate, those days are over. Part boot, part sneaker, it uses winterized materials in a toe-to-heel overhaul that''s designed to help you stay warm and dry without losing the iconic AJ1 appeal. The iconic toe has a debossed dot pattern instead of perforations.', 'https://media2.fenom.com/76199-product_large/jordan-w-air-jordan-1-acclimate-dusty-pink.jpg', 15000, 20, 'Jordan Acclimate Dusty Pink', 'FEMALE', 'Dusty Pink', 14);
